        const api_url = await
        fetch(`api.openweathermap.org/data/2.5/weather?q=Kiev&appid=${API_KEY}&units=metric`);
        const data = await api_url.json();
        console.log(data)
}
        return(
            <div>
              <Info/>
                <Form/>
                <Weather/>
            </div>
        )




}

export default App
